import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { RhRoutingModule } from './rh-routing.module';
import { ListeEmployeComponent } from './components/employe/liste-employe/liste-employe.component';
import { AjouterContratComponent } from './components/contrat/ajouter-contrat/ajouter-contrat.component';


@NgModule({
  declarations: [ListeEmployeComponent, AjouterContratComponent],
  imports: [
    CommonModule,
    RhRoutingModule
  ]
})
export class RhModule { }
